INSERT INTO `job_vacancy` VALUES (1,1,'Automobile AC Technician','Need An engineer Who is Skilled In AC Fixing','Mercedes-Benz',NULL,'benz','Skill: Electrical Engineering, Min: UG passout','RS-16700','1-5 years','Work from home','Electrical Engineer','K≈çchi,Kochi Prefecture,Kochi Prefecture','Monday-Friday','Full-time','2024-08-24 00:00:00',1,0,'2024-07-25 04:06:35','2024-07-25 04:07:11'),(2,3,'Need UI/UX Designer','Need a UI/UX Designer Ready to work and ready on call. ','My Design Space LTD',NULL,'my_design','Experience in React, HTML,CSS,JS and have Creative Thought','RS-120000','1-5 years','Hybrid','UX/UI Designer','Hong Kong,undefined','Monday-Friday','Full-time','2024-08-24 00:00:00',0,0,'2024-07-25 04:53:59','2024-07-25 04:53:59'),(3,2,'Senior Aerodynamics Engineer','**1. Design and Analysis:\n\n    Lead the aerodynamic design process for new products or improvements to existing designs.\n    Use Computational Fluid Dynamics (CFD) tools and wind tunnel testing to analyze and optimize aerodynamic performance.\n    Develop and implement aerodynamic models and simulations.\n\n**2. Research and Development:\n\n    Conduct research to explore new aerodynamic technologies and methodologies.\n    Stay updated with the latest advancements in aerodynamics and related fields.\n\n**3. Testing and Validation:\n\n    Plan and oversee wind tunnel tests, flight tests, or other experimental methods to validate aerodynamic designs.\n    Analyze test data to refine models and improve performance predictions.','Raven Aeronautics ',NULL,'raven_official','1. Educational Background:\n\n    Bachelor\'s degree in Aerodynamics, Aerospace Engineering, Mechanical Engineering, or a related field is required.\n    A Master\'s or Ph.D. in Aerodynamics or a related field is often preferred.\n\n**2. Experience:\n\n    Several years (typically 5-10 years) of experience in aerodynamics engineering, with a proven track record of working on relevant projects.\n    Experience in using CFD tools, such as ANSYS Fluent, OpenFOAM, or STAR-CCM+, and familiarity with wind tunnel testing.\n\n**3. Skills and Competencies:\n\n    Strong analytical and problem-solving skills, with the ability to interpret complex data and make informed decisions.\n    Proficiency in programming languages such as Python, MATLAB, or C++ is often required for developing models and simulations.\n    Excellent communication and teamwork skills, with the ability to collaborate effectively with diverse teams.\n    Detail-oriented and capable of managing multiple projects simultaneously.\n\n**4. Knowledge:\n\n    In-depth understanding of fluid dynamics, thermodynamics, and other relevant principles.\n    Familiarity with industry standards, regulations, and certification processes related to aerodynamics.\n\n**5. Additional Qualities:\n\n    A proactive approach to innovation and a willingness to explore new technologies and methodologies.\n    Leadership capabilities and experience in project management can be an asset for senior-level positions.\n\n','DLR-60000','5-10 years','Onsite','Aircraft Mechanic','Sydenham','Monday-Friday','Full-time','2024-08-24 00:00:00',1,0,'2024-07-25 04:59:08','2024-07-25 08:27:41'),(4,2,'Aeronautical Engineer','**1. Design and Analysis:\n\n    Lead the aerodynamic design process for new products or improvements to existing designs.\n    Use Computational Fluid Dynamics (CFD) tools and wind tunnel testing to analyze and optimize aerodynamic performance.\n    Develop and implement aerodynamic models and simulations.\n\n**2. Research and Development:\n\n    Conduct research to explore new aerodynamic technologies and methodologies.\n    Stay updated with the latest advancements in aerodynamics and related fields.\n\n**3. Testing and Validation:\n\n    Plan and oversee wind tunnel tests, flight tests, or other experimental methods to validate aerodynamic designs.\n    Analyze test data to refine models and improve performance predictions.','Raven Aeronautics ',NULL,'raven_official','1. Educational Background:\n\n    Bachelor\'s degree in Aerodynamics, Aerospace Engineering, Mechanical Engineering, or a related field is required.\n    A Master\'s or Ph.D. in Aerodynamics or a related field is often preferred.\n\n**2. Experience:\n\n    Several years (typically 5-10 years) of experience in aerodynamics engineering, with a proven track record of working on relevant projects.\n    Experience in using CFD tools, such as ANSYS Fluent, OpenFOAM, or STAR-CCM+, and familiarity with wind tunnel testing.\n\n**3. Skills and Competencies:\n\n    Strong analytical and problem-solving skills, with the ability to interpret complex data and make informed decisions.\n    Proficiency in programming languages such as Python, MATLAB, or C++ is often required for developing models and simulations.\n    Excellent communication and teamwork skills, with the ability to collaborate effectively with diverse teams.\n    Detail-oriented and capable of managing multiple projects simultaneously.\n\n**4. Knowledge:\n\n    In-depth understanding of fluid dynamics, thermodynamics, and other relevant principles.\n    Familiarity with industry standards, regulations, and certification processes related to aerodynamics.\n\n**5. Additional Qualities:\n\n    A proactive approach to innovation and a willingness to explore new technologies and methodologies.\n    Leadership capabilities and experience in project management can be an asset for senior-level positions.\n\n','DLR-60000-','1-5 years','Onsite','Aircraft Mechanic','Sydney','Monday-Friday','Full-time','2024-08-24 00:00:00',0,0,'2024-07-25 05:05:11','2024-07-25 08:28:12'),(5,4,'Defence Research','need to build a product','scorp',NULL,'Sid','should build a product','RS-10000-','10+ years','Onsite','Electrical Engineer','Mumbai,Maharashtra,Maharashtra','Monday-Saturday','Full-time','2024-08-01 00:00:00',0,0,'2024-07-25 05:23:15','2024-07-25 05:25:03'),(6,3,'QWERTY-UI','Internship For UG for UI/UX design','My Design Space LTD',NULL,'my_design','No minimum Requirement','RS-5001-','1-5 years','Onsite','UX/UI Designer','Hong Kong,undefined','Monday-Friday','Internship','2024-08-24 00:00:00',0,0,'2024-07-25 05:29:15','2024-07-25 05:33:49'),(7,6,'Technician','As a Laboratory Technician, you will be integral to conducting scientific experiments and analyses in a laboratory setting. Your primary responsibilities will include preparing and analyzing samples, operating and maintaining laboratory equipment, and ensuring the accuracy and reliability of test results. You will be responsible for documenting and interpreting findings, adhering to strict safety protocols, and maintaining a clean and organized work environment.','Roguestar',NULL,'jonathan','The ideal candidate for the Laboratory Technician position will hold an Associate‚Äôs or Bachelor‚Äôs degree in Laboratory Technology, Biological Sciences, Chemistry, or a related field. Previous experience in a laboratory setting is preferred, with a strong familiarity with relevant techniques and equipment being advantageous. Candidates should demonstrate proficiency in operating and maintaining laboratory instruments, possess strong analytical and problem-solving skills, and exhibit meticulous attention to detail in their work. Effective communication skills are essential for reporting findings and collaborating with team members.','RS-40000-','1-5 years','Work from home','Laboratory Technician','Kerala,undefined','Monday-Friday','Full-time','2024-08-10 00:00:00',0,0,'2024-07-25 06:27:18','2024-07-25 06:27:51');
